import { getItems } from '../actions/item';
import Itemcard from '../components/item/ItemCard';
import { isAuth } from '../actions/auth';

const Main = () => {

    const showListedItems = () => {
        const token = isAuth().token;
        console.log('************************')
        console.log(token);
        console.log('************************')
        const items = getItems(token);
        console.log('************************')
        console.log(items);
        console.log('************************')
        const cards = items.map((item, i) => {
            return (
                <article key={i}>
                    <ItemCard item={item}/>
                </article>
            );
        });
        return cards;
    };

    return (
        <div className='main'>
            <div className='main__title'>
                <h2>Shopping List</h2>
            </div>
            <div className='main__body'>
                {showListedItems()}
            </div>
        </div>
    );
};

export default Main;
